import React from "react";

export default function Card({ headText, headerSize, text, link, extraClass }) {
  let header;
  if (headSize == 1) {
    header = <h1>headText</h1>;
  }

  return (
    <div className={extraClass}>
      {header}
      <p>
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
